import VueRouter from 'vue-router';
import First_page from '@/App.vue'
import Create_lobby from '@/components/create_lobby.vue';

const routes = [
    {
        path: '/', 
        redirect: '/home' 
    }, {
        path: '/home',
        component: First_page
    }, {
        path: '/create_lobby',
        component: Create_lobby
    }
]

const router = VueRouter.createRouter({
	history : VueRouter.createWebHashHistory(),
    routes: routes
});
